import {Fragment} from "react";
import cake from '../../Assets/cake.jpg'
const Header=(props)=>{
    return(
        <Fragment>
        <header>
        <h1>Bakery</h1>
        <button>Cart</button>
        </header>

        <div>
        <img src="cak " >   </img>
        
        </div>

        </Fragment>
    );
}
export default Header
